remember_window_size  yes
hide_window_decorations yes
enable_audio_bell no
mouse_hide_wait 2.0
cursor_shape block
shell_integration no-cursor

map ctrl+j previous_window
map ctrl+k next_window
map ctrl+h toggle_layout stack
map kitty_mod+enter launch --cwd=current

map kitty_mod+t new_tab_with_cwd
map kitty_mod+j previous_tab
map kitty_mod+k next_tab
map kitty_mod+n set_tab_title " "

map kitty_mod+f launch --type=overlay --stdin-source=@screen_scrollback fzf --no-sort --no-mouse --exact -i
map kitty_mod+u launch --stdin-source=@screen_scrollback --stdin-add-formatting less +G -R

font_family JetBrains Mono
background_image background.png
background_image_layout cscaled
background_tint 1

